function Register() {
  return (
    <section className="w-[100%] bg-[#F2F5F8] py-[40px]">
      <div className="w-full px-[6%]">
        <RegisterTitle />
      </div>
    </section>
  );
}

function RegisterTitle() {
  return (
    <section className="flex justify-center w-full py-[10px] flex-wrap">
      <h2 className="text-[23px] md:text-[29px] lg:text-[33px] xl:text-[36px] font-semibold text-slate-700">
        در کمتر از ۱۰ دقیقه ثبت‌نام کنید و به
        <strong className="text-[#21AA58]">
          <em>ناوگان اسنپ </em>
        </strong>{" "}
        بپیوندید.
      </h2>
      <p className="text-[18px] my-[16px]">
        بدون نیاز به مراجعه‌ی حضوری، از طریق این صفحه، تمام مراحل ثبت‌نام را
        اینترنتی انجام دهید
      </p>
    </section>
  );
}

export default Register;
